import React, { Component } from 'react'
import { withOktaAuth } from '@okta/okta-react'
import API from '../misc/api'


class Product extends Component {
    state = {
        product: []
    }

    async componentDidMount() {
        this.getProducts(1)
    }

    getProducts = async (page) => {
        const authenticated = await this.props.authState.isAuthenticated
        if (authenticated !== this.state.authenticated) {
            const user = await this.props.oktaAuth.getUser()
            this.setState({ authenticated, user })
            console.log(this.props.authState)
        }
        API.get(`products?page=${page}`, {
            headers: {
                'Authorization': 'Bearer ' + await this.props.authState.accessToken.accessToken
            }
        })
            .then(response => {
                console.log(response.data)
                this.setState({
                    product: response.data
                })
            })
            .catch(error => {
                console.log(error)
            })
    }
    render() {
        return (
            <div>

            </div>
        )
    }
}

export default Product
